import React , { Component }from 'react';
import Styles from './House.css';
import Roof from "../roof/Roof";
import Body from "../body/Body";



class House extends Component {
    constructor(props){
        super(props);
        this.state = {

        }
    }
    getRandomColor=()=>{
        const letters = '0123456789ABCDEF';
        let color = '#';
        for (let i = 0; i < 6; i++) {
             color += letters[Math.floor(Math.random() * 16)];
        }
        return color;
    };
    changeColor=(e)=>{
         e.target.style.background = this.getRandomColor();
    };
    changeRoofColor=(e)=>{
        e.target.style.borderColor = this.getRandomColor();
    };
    render(){
        return (
            <div className={Styles.House}>
                <Roof changeRoofColor={this.changeRoofColor} />
                    <Body
                        changeWindowColor = {this.changeColor}
                        changeDoorColor = {this.changeColor}
                    />
            </div>
        )
    }
}

export default House;
